Sure! Here's an implementation of binary exponentiation in Rust:

```rust
fn binary_exponentiation(mut base: i64, mut exp: i64) -> i64 {
    let mut result = 1;

    while exp > 0 {
        if exp % 2 == 1 {
            result *= base;
        }

        base *= base;
        exp /= 2;
    }

    result
}

fn main() {
    let base = 2;
    let exp = 10;

    let result = binary_exponentiation(base, exp);
    println!("{}^{} = {}", base, exp, result);
}
```

This function calculates `base` raised to the power of `exp` using binary exponentiation algorithm. It starts with `result` initialized to 1 and iterates through the binary representation of `exp`, updating `result` and squaring `base` at each step.

